const checkFit = (word, startCell, directions) => {
  let isFit = true;

  switch (directions) {
    case "toRight":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x + i, startCell.y);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    case "toLeft":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x - i, startCell.y);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    case "toTop":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x, startCell.y - i);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    case "toBottom":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x, startCell.y + i);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    case "toRightTop":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x + i, startCell.y - i);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    case "toRightBottom":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x + i, startCell.y + i);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    case "toLeftTop":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x - i, startCell.y - i);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    case "toLeftBottom":
      for (let i = 0; i < word.length; i++) {
        let cellElement = getCell(startCell.x - i, startCell.y + i);
        if (cellElement == undefined || $(cellElement).html() != "") {
          isFit = false;
        }
      }
      break;

    default:
      break;
  }
  return isFit;
};

const fillCell = (word, startCell, directions) => {
  let charArray = word.split("");
  let clueCell = {
    word: word,
    direction: directions,
    cells: [],
    answered: false,
  };
  switch (directions) {
    case "toRight":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x + i,
          y: startCell.y,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x + i, startCell.y);
        $(cellElement).html(c);
      });

      break;

    case "toLeft":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x - i,
          y: startCell.y,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x - i, startCell.y);
        $(cellElement).html(c);
      });
      break;

    case "toTop":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x,
          y: startCell.y - i,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x, startCell.y - i);
        $(cellElement).html(c);
      });
      break;

    case "toBottom":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x,
          y: startCell.y + i,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x, startCell.y + i);
        $(cellElement).html(c);
      });
      break;

    case "toRightTop":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x + i,
          y: startCell.y - i,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x + i, startCell.y - i);
        $(cellElement).html(c);
      });
      break;

    case "toRightBottom":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x + i,
          y: startCell.y + i,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x + i, startCell.y + i);
        $(cellElement).html(c);
      });
      break;

    case "toLeftTop":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x - i,
          y: startCell.y - i,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x - i, startCell.y - i);
        $(cellElement).html(c);
      });
      break;

    case "toLeftBottom":
      charArray.forEach((c, i) => {
        let cell = {
          x: startCell.x - i,
          y: startCell.y + i,
        };
        clueCell.cells.push(cell);
        let cellElement = getCell(startCell.x - i, startCell.y + i);
        $(cellElement).html(c);
      });
      break;

    default:
      break;
  }

  clueMap.push(clueCell);
};

function shuffleArray(array) {
  for (let i = array.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [array[i], array[j]] = [array[j], array[i]];
  }
  return array;
}

const sortArrayByLength = (array, isAsc = true) => {
  if (isAsc) {
    array.sort((a, b) => a.length - b.length);
  } else {
    array.sort((a, b) => b.length - a.length);
  }

  return array;
};

